import React from 'react'
import { StyleSheet, Text, View, ScrollView, Dimensions, Image } from 'react-native'
import ReusableBtn from '../../buttons/ReusableBtn'

const WelcomeScreen2 = () => {
    return (
        <ScrollView>
            <Image style={styles.image} />
            <View style={styles.page}>
                <Text>Hi Mehedi</Text>
                <Text style={styles.heading}>Welcome Aboard!</Text>
                <Text>Ready for your new food  experiences? Discover your next favourite food through mystery dishes, customized just for you.</Text>
                <ReusableBtn btnText="Create Flavour Profile" />
            </View>

        </ScrollView>
    )
}

export default WelcomeScreen2

const styles = StyleSheet.create({
    image:{
        height: Dimensions.get("screen").width,
        width: Dimensions.get("screen").width,
        backgroundColor: "lightgray",
        marginTop: Dimensions.get("screen").width * 0.15
    },
    page:{
        width: Dimensions.get("screen").width * 0.8,
        marginLeft: Dimensions.get("screen").width * 0.1,
        marginTop: 30
    },
    text:{
        marginBottom: 15
    },
    heading:{
        fontSize: 30,
        fontWeight: "bold",
        marginTop: 10,
        marginBottom: 15,
        lineHeight: 40
    }
})
